(19, 0, 'Palmetto Automatic Sprinkler Co Inc', 'Richard Miskie', 'Fire Protection Designer', 0, '4/18/2015', '1862 Old Dunbar Rd.', 'W Columbia', 'South Carolina', '29172', 'USA', '(803) 794-1602', 'rmiskie@pasco-inc.com', 'www.pasco-inc.com', 'Fire Sprinkler System layout/design, coordination, hydraulic calculation, listing for fabrication.  Applicant must be familiar with NFPA 13 and proficient in the use of all Hydratec software', '1', 0, 0, 58511),
(20, 0, 'Grapevine FP', 'Design Manager', 'Fire Protection Designer', 0, '4/18/2015', '609 Industrial Blvd', 'Grapevine', 'Texas', '', 'USA', '(817) 416-0160', 'grapevinefp@yahoo.com', '', 'Immediate opening is available in our Design Department for a full-time New Construction Fire Protection Designer - Design Manager. This position requires the applicant to be proficient in the following categories.  Large scale projects such as high Rise buildings, Hospitals, Aircraft Hangars, and Warehouses.  Experience Fire Pumps, both, Pre-Action and Dry Systems, ESFR, Storage and Rack Systems, Standpipe Systems.  BIM Modeling, working in 3D environments, coordinating with 3D models produc', '1', 0, 0, 14297),
