(29, 0, 'Fire Protection Systems Inc', 'Tony M Gibson', 'Fire Protection Designer', 0, '4/18/2015', '22 Industrial Park Drive', 'Hendersonville', 'Tennessee', '37075', 'USA', '(615) 822-3600', 'tgibson@fireprosys.com', 'www.fireprotectionsys.com', 'We are looking for a talented fire protection designer who has the capability of taking over and running a busy design department. There will be no effort to micro-manage the right person. Our company has been in business for 38 years in the same location, just outside of the thriving Nashville, TN on beautiful Old Hickory Lake. Individual will need to be extremely proficient in 3-D design, Design-Build projects, Hydratech, and prevailing NFPA codes. Candidate must know how to teach, develop les', '1', 0, 0, 97522),
