(31, 0, 'RCI Systems Inc ', 'Aaron Bennett', 'Fire Protection Designer', 0, '4/18/2015', '1220 W Geneva Drive', 'Tempe', 'Arizona', '85282', 'USA', '(480) 894-8711', 'abennett@rcifire.com', 'www.rcifire.com', 'Tempe, Arizona fire sprinkler contractor seeking an experienced fire sprinkler system CAD designer for our rapidly growing office. The ideal candidate will have a minimum of 5 years fire protection sprinkler experience. He or she must have experience in layout and hydraulic calculations of wet pipe, dry pipe, pre-action and specials hazards. Some of the responsibilities include, but are not limited to, obtaining local authority approvals; effectively coordinating with architectural, structural a', '1', 0, 0, 91985),
(32, 0, 'CRO Engineering Group Inc', 'Ben Healy', 'Electrical Designer', 0, '4/18/2015', '18652 Florida Street', 'Huntington Beach', 'California', '92648', 'USA', '(714) 847-7100', 'BHealy@croeg.com', 'www.croeg.com', 'Electrical Design Project Manager CRO Engineering Group, Inc.  Huntington Beach, CA CRO Engineering Group seeks an Electrical Design Project Manager to join our team in beautiful Huntington Beach, CA. The majority of this individual\\&#39;s time will be spent designing electrical power and lighting systems and managing projects from start to finish. To apply, please send resumes to BHealy@croeg.com The primary function of this position is to manage and design projects, report internally to man', '1', 0, 0, 13717),
(33, 0, 'Hooper Corporation', 'Kaitlyn Recob', 'Fire Protection Designer', 0, '4/18/2015', '2030 Pennsylvania Ave', 'Madison', 'Wisconsin', '53704', 'USA', '(608) 268-2132', 'krecob@hoopercorp.com', 'www.hoopercorp.com/', 'General Summary: Responsible for the layout and design of fire protection systems in accordance with all applicable government codes and per scope of assigned contract. Principal Accountabilities:  Prepares layout and design of fire protection systems in accordance with applicable local, state, and national codes within the scope of the contract while meeting customer needs.  Prepares hydraulic calculations that support complete design of appropriate Fire Protection systems.  Performs field s', '1', 0, 0, 99496),
(65, 0, 'Troy Life &#38; Fire Safety Ltd.', 'Sara McCartney', 'Fire Protection Designer', 0, '7/8/2015', '5051 13th Street S.E', 'Calgary', 'Alberta', 'T2G 5N1', 'Canada', '(519) 371-4747', 'hr@troylfs.com', 'www.troylfs.com', 'Design, calculate, stock list and project manage fire sprinkler projects in a construction environment. Entails the use of formal AutoCAD software and hydraulic calculations. Post-secondary education in Fire Protection Engineering &#38; Technology or equivalent. Minimum of 2-5 years experience in the field of fire protection design. Strong background in design layout, hydraulic calculations, stock listing and project management. NICET certification and/or have the ability to become certified.', '1', 0, 0, 97050),
(51, 0, 'American Fire Protection, Inc.', 'Doug Greer', 'Fire Protection Designer', 0, '5/2/2015', 'PO Box 4139', 'Greenville', 'South Carolina', '29608', 'USA', '(864) 250-2001', 'dgreer@americanfireprotection.net', 'www.americanfireprotection.net', 'prefer min. 2 years experience. NICET Cert. not required AutoCAD, HydraCad, Microsoft Suite, Adobe, Office and Field work 4/10\\\\\\&#39;s Pay on experience / abilities', '0', 0, 0, 24462),
(64, 0, 'A &#38; F Fire Protection Co., Inc.', 'Carol Remondino', 'Fire Protection Designer', 0, '7/2/2015', '28 E. Chestnut Street', 'Massapequa', 'New York', '11758', 'USA', '(516) 541-4600', 'carol@af-fire.com', '', 'Fire Protection Engineer / Sprinkler Designer wanted for Long Island, New York fire sprinkler company.  Preferably with 2 - 5 years experience in the fire sprinkler contracting industry. Familiar with AutoCAD, SprinkCad, and Hydraulic calculations.', '1', 0, 0, 21999),
(53, 0, 'IT&#38;M Division, Inc.', 'Kevin Briceno', 'Fire Protection Designer', 0, '5/19/2015', '1101 Chestnut Street', 'Helena', 'Montana', '59601', 'USA', '(406) 495-1543', 'kevin@itmdivision.com', 'WWW.itmdivision.com', 'The Great State of Montana Business 22 year fire sprinkler contractor seeking to provide a new position for a Nicet Level III /IV designer. Great wages, benefits, 401 K, vacation. Super work environment, leading industry software and computers, large office space and many more benefits. Serious applicants only need apply. ', '0', 0, 0, 32347),
(55, 0, 'Northwest Fire Systems', 'Clark Potter ', 'Fire Protection Designer', 0, '5/27/2015', '7815 South 180th, Kent, WA', 'Kent', 'Washington', '', 'USA', '(206) 772-7502', 'cpotter@nwfiresystems.com', 'www.nwfiresystems.com', 'We are looking for a Level III designer or someone that can test and get their level III within the next 12 months. We are a small family owned union sprinkler company that is known and respected in the greater Puget sound region. We have a niche market and enjoy working with some of the best contractors in the Seattle area. We are involved with new construction as well as service. ', '0', 0, 0, 63042),
(56, 0, 'Coffman Engineers', 'Dedrie Harper', 'Fire Protection Designer', 0, '5/28/2015', '2011 N 22nd Ave', 'Bozeman', 'Montana', '59718', 'USA', '(206) 623-0717', 'harper@coffman.com', 'www.coffman.com', 'Coffman Engineers Bozeman office is growing and we need several highly skilled Fire Protection Designer/Technicians at all skill levels to join our busy team. ', '1', 0, 0, 49925),
(75, 129, 'TG Gallagher', 'Heather McDougall', 'Fire Protection Designer', 0, '10/20/2015', '109 Smith Place', 'Cambridge', 'Massachusetts', '02138', 'USA', '(617) 661-7000', 'hmcdougall@tggallagher.com', 'tggallagher.com', 'Primary responsibilities:&#13;&#10;Working under the supervision of our sprinkler operations manager, the fire sprinkler designer will: &#13;&#10;&#9;Design layouts of fire sprinkler systems, including coordination with other MEP trades&#13;&#10;&#9;Perform hydraulic calculations and stock listing&#13;&#10;&#9;Attend virtual and project coordination meetings &#13;&#10;&#9;Perform field surveys and hydrant flow tests&#13;&#10;&#9;Provide occasional support to estimating department to prepare / review bid drawings&#13;&#10;&#13;&#10;Qualifications&#13;&#10;&#9;5 years previous experience performing sprinkler design and calculations&#13;&#10;', '0', 0, 1, 66151),
