(142, 215, 'VFS Fire &#38; Security Services', 'Elizabeth Ziebell', 'Fire Alarm/Special Hazard Designer', 0, '6/19/2017', '501 West Southern Avenue', 'Orange', 'California', '92865', 'USA', '(714) 778-6070', 'elizabeth.z@vfsfire.com', 'www.vfsfire.com', 'Join our Team! Let us help you develop your career and achieve your goals. &#13;&#10;&#13;&#10;Competitive wages, bonuses, retirement plan and benefit package.&#13;&#10;&#13;&#10;We are seeking quality individuals with minimum five (5) years experience in fire alarm design.  CAD, AutoSprink, BIM, Navisworks, NICET certification a plus. Must have a working knowledge of NFPA, layout, design, survey work and stock listing.', '0', 0, 0, 94599),
(145, 269, 'Champion Fire Protection, Inc.', 'Wes Dorman', 'Fire Protection Designer', 0, '11/7/2017', '825 Wheaton Street', 'Savannah', 'Georgia', '31401', 'USA', '(912) 234-0111', 'wdorman@championfp.com', 'www.championfp.com', 'NICET II minimum fire sprinkler designer.  3 years minimum experience.  Proficient w/Auto Sprink. &#13;&#10;Excellent opportunity for in house designer.  Coastal city, excellent compensation package, including vacation, 401K.  ', '1', 0, 0, 3596),
(148, 278, 'Monona Plumbing &#38; Fire Protection', 'Lisa Reiter', 'Fire Protection Designer', 0, '12/8/2017', '3126 Watford Way', 'Madison', 'Wisconsin', '53713', 'USA', '(608) 216-9089', 'lreiter@mononapfp.com', 'www.mononapfp.com', 'The Fire Protection Designer is responsible for the complete design and management of fire protection (sprinkler) projects to include design, submittal, survey, and fabrication.  Designs include but are not limited to wet and dry sprinkler systems, standpipe systems, and fire pump room layouts.   &#13;&#10;', '1', 0, 1, 84107),
(149, 258, 'Balanced Comfort', 'Aaron Husak', 'Fire Protection Designer', 1, '1/10/2018', '5456 W Mission Ave', 'Fresno', 'California', '93722', 'USA', '(559) 243-6464', 'Aaron@balancedcomfort.com', 'www.balancedcomfort.com', 'Balanced Comfort is a fast growing company that is adding a fire protection designer to its design team. Our company was established in 2012 and has grown into a full service fire protection, mechanical and plumbing design firm. We currently have a Mechanical PE and a NICET level 4 designer on staff to meet with growing demands for our high quality services. We work on all types of projects, from complicated Quell systems to Residential homes in the United States and Abroad.&#13;&#10;&#13;&#10;Benefits include:&#13;&#10;85% Medical Coverage&#13;&#10;Full Dental and Vision&#13;&#10;Life Insurance benefits', '0', 0, 0, 26014),
(147, 273, 'Automatic Fire Sprinkler Company LLC', 'Jason Smith', 'Fire Protection Designer', 0, '11/10/2017', '1809 Industrial Park Drive', 'Normal', 'Illinois', '61761', 'USA', '(309) 862-2724', 'jasons@autofiresprinkler.com', 'autofiresprinkler.com', 'We are currently looking for a highly motivated fire sprinkler designer to head up our design team.  NICET III cetrification preferred or the ability to obtain the level III certification within 12 months.  Candidate should have a vast knowledge of the Auto Sprink design program.  Offering competitive compensation based on knowledge and certification level.  Please send resume including wage and package requirements to jasons@autofiresprinkler.com.  We will be open to help with relocation cost if necessary.', '0', 0, 0, 58569),
(152, 288, 'Ahern Fire Protection', 'Sarah Kirchner', 'Fire Protection Designer', 1, '1/15/2018', '2675 Scott Avenue C', 'St Louis', 'Missouri', '63103', 'USA', '(920) 921-9020', 'aherncareers@jfahern.com', 'www.aherncareers.com', 'As a Senior Designer you will exercise your attention to detail while designing automatic sprinkler systems using HyrdaCAD, an AutoCAD based software product. In conjunction with a Sales Project Manager you will plan, organize and execute projects through activities such as; on-site field surveys, generating hydraulic calculations, submitting drawings to obtain the required building permits, 3D BIM coordination using NavisWorks, preparing stock lists, ensuring the projects adhere to the proposed timeline, and preparing project close-out, operation and maintenance documents.', '1', 0, 0, 63712),
(151, 103, 'Crown Fire Systems', 'David Kyllo', 'Fire Protection Designer', 1, '1/12/2018', '7402 SE Johnson Creek Blvd.', 'Portland', 'Oregon', '97206', 'USA', '(503) 777-5030', 'dave@crownfiresystems.com', 'crownfiresystems.com', 'In need of a fire sprinkler designer with Sprinkcad or Autosprink experience. Will train right candidate', '1', 0, 0, 53840),
(155, 301, 'Fire &#38; Life Safety America', 'David Mackin', 'Fire Protection Designer', 0, '2/5/2018', '3017 Vernon Road', 'Richmond', 'Virginia', '23228', 'USA', '(804) 497-1093', 'dmackin@flsamerica.com', '', 'Full time sprinkler designer position available in the Richmond VA office of Fire &#38; Life Safety America (FLSA).&#13;&#10;Excellent pay &#38; benefits', '0', 0, 0, 79526),
(156, 303, 'Mid Atlantic Fire Protection, Inc.', 'David Reynolds', 'Fire Protection Designer', 0, '2/5/2018', '5596 Greenwich Road', 'Virginia Beach', 'Virginia', '23462', 'USA', '(757) 455-8888', 'dreynolds@midatlanticfireprotection.com', 'www.midatlanticfireprotection.com', 'We are looking for a fire sprinkler designer with experience designing NFPA 13 and 13R systems. We currently use HydroCAD as well as 3D design in Revit.  We would prefer a designer that is in the NICET program and work there way to a level 3.  We offer 401k, dental, medical, long term disability, and life insurance.', '0', 0, 0, 48014),
(154, 297, 'CopperState Fire Protection', 'Erica Goulden', 'Fire Alarm/Special Hazard Designer', 1, '1/24/2018', '1830 N 95th Ave, Ste 106', 'Phoenix', 'Arizona', '85037', 'USA', '(801) 395-8799', 'egoulden@fps-ul.com', 'www.copperstatefire.com', 'Looking for experienced fire alarm designer in Phoenix Arizona. &#13;&#10;Requirements:&#13;&#10;*CAD Experience&#13;&#10;*NICET Fire Alarm Systems II required, III preferred&#13;&#10;*Notifier experience preferred&#13;&#10;&#13;&#10;To apply please visit www.copperstatefire.com/careers/', '0', 0, 0, 64395),
(157, 305, 'A&#38;D Fire Sprinklers', 'Derrek Crigler', 'Fire Protection Designer', 1, '2/6/2018', '7130 convoy ct', 'San Diego ', 'California', '92117', 'USA', '(858) 277-3473', 'derrek@adfiresprinklers.com', 'Adfiresprinklers.com', 'Fire Sprinkler System Designer&#13;&#10;', '0', 0, 0, 10689),
(158, 306, 'Universal Fire Systems, Inc', 'Malissa Booth', 'Fire Protection Designer', 0, '2/7/2018', '374 Hobbs Rd.', 'Tampa', 'Florida', '33619', 'USA', '(813) 662-9200', 'mbooth@ufsitampa.com', '', 'Universal Fire Systems is an established fire sprinkler company with 25 years of business in the Tampa area. We are currently seeking motivated people to join our design team. Our Fire Sprinkler Designers are responsible for the creation of fire sprinkler plans and hydraulic calculations for permitting and installation, coordination with other trades, job site visits, communication with contractors, engineers and AHJ&#39;s. This is a full-time position that could require overtime depending on project schedules. Universal Fire encourages career advancement with Revit training classes, in-house sprinkler technology learning sessions and assistance in NICET testing.&#13;&#10;&#13;&#10;', '0', 0, 0, 56496),
(159, 313, 'NRG Fire Consulting ', 'Sean Pisoni', 'Fire Protection Designer', 1, '2/7/2018', '4000 Aurora Ave N #222', 'Seattle', 'Washington', '98103', 'USA', '(206) 789-0165', 'spisoni@nrgfireconsulting.com', 'www.nrgfireconsulting.com', '&#9;Turn-key fire suppression system design capabilities for small to large commercial projects, bid spec to permit level detail, as required by the specific project. Includes preparation of hydraulic and seismic calculations, fire code analysis and compliance, equipment cut sheet preparation, AHJ and client interactions, etc. &#13;&#10;&#9;Work with clients directly to provide one-on-one interaction and problem solving. Clients can include architects, contractors, owners, and AHJs. &#13;&#10;&#9;Understanding of local and national fire codes, standards, and fire suppression technologies&#13;&#10;&#9;Some travel is required in US and Canada', '1', 0, 0, 20956),
(160, 314, 'Accel Fire Systems Inc.', 'Brent Overmyer', 'Fire Protection Designer', 1, '2/8/2018', '3365 SILICA RD', 'SYLVANIA', 'Ohio', '43560', 'USA', '(419) 843-7756', 'accelfire@accelfiresystem.com', 'www.accelfiresystem.com', 'NICET 3 Certified Fire Sprinkler Designer. Design water-based automatic systems per contract specs, NFPA, State and Local codes.  Interpret plans and specs to provide layout of code compliant systems in addition to hydraulic calcs and stock listing materials.  Extensive knowledge of various types of systems, equipment and design, including commercial, industrial and residential applications. Ability to complete site survey. Knowledge of HydraCAD, AutoCAD, Navisworks and other design software.', '1', 0, 0, 89532),
(161, 318, 'Elite Automatic Fire Protection', 'Jordan Hopkins', 'Fire Protection Designer', 1, '2/12/2018', '3856 Cincinnati Ave', 'Rocklin', 'California', '95765', 'USA', '(916) 672-8415', 'jordan@eafire.net', 'eafire.net', 'We are looking for a fire sprinkler designer to join our team.  Prefer candidates with 3-5 years experience in fire sprinkler design.  Some experience in fire sprinklers required, training available.  ', '0', 0, 0, 48730),
(162, 325, 'Randall Mechanical', 'Rob Dailey', 'Fire Protection Designer', 1, '2/21/2018', '3307 Clarcona Road', 'Apopka', 'Florida', '32703', 'USA', '(407) 464-7776', 'rdailey@randallmechanical.com', 'randallmechanical.com', 'Randall Mechanical is a growing family-owned Central Florida contractor with over 600 employees who is looking for driven, experienced and professional Fire Sprinkler Service Designers to join our team.&#13;&#10;Requirements:&#13;&#10;&#9;2 - 3 Years of experience&#13;&#10;&#9;Auto Sprink and HydraCAD Experience&#13;&#10;&#9;Hydraulic calculating required&#13;&#10;&#9;Site survey required&#13;&#10;&#9;Fire Sprinkler Code Sufficient&#13;&#10;&#9;Proficient with Outlook &#38; Excel', '0', 0, 0, 37732);
