INSERT INTO `testimonials` (`ID`, `Company`, `Contact`, `Position`, `Testimonial`, `Public`, `Date`, `New`) VALUES
(17, 'Western States Fire Protection', 'Rick Charles', 'VP', 'I have been in this industry for over twenty years and I only know of about two freelance designers. They are just hard to find. DesignerHub has become a great resource for us to find that next freelance designer for our next project. Being the largest union fire protection company in the country, and with dozens of offices in the western United States, I would recommend DesignerHub to all our branches needing design help. ', 1, '11/16/2015', 0),
(2, 'Fire Design Colorado LLC', 'Alan Bruch', 'Owner', 'The Designer Hub has been an affordable and effective way to advertise my business. I now have new long term clients from companies in New Mexico, Utah, and Denver thanks to Designer Hub. I would recommend Designer Hub to any Freelance Designer looking to increase their number of clients.', 1, '3/17/2015', 0),
(7, 'MTA Fire Protection Consultants', 'Kent Stewart', 'President', 'We have been in business since 1986 as a fire protection design consulting firm. We have designed fire sprinkler projects of all kinds for many different sprinkler contractors across the country. DesignerHub has been a great benefit for our company since joining. We have made several new business connections as a result of our Designer Hub listing.', 1, '4/17/2015', 0),
(20, 'Thompson Fire Sprinkler Design', 'Dana Thompson', 'Owner', 'At Thompson Fire Sprinkler Design - We estimate, that over 50% of our work is being generated from Designer Hub, and now receiving design opportunities internationally. Designer Hub has become an important part of our success. ', 1, '5/3/2016', 0),
(23, 'National Fire ', 'Basheer', 'Manager  Fire  Safe', 'DesignerHub provides a good platform, for a fire design company like us, to offer cost effective design support with improved quality.', 1, '2/15/2018', 0);
